import {Image} from "primereact/image";

export function Preview(attr) {

    const icon = (<i className="pi pi-search"></i>)

    return (
        <div className={"flex flex-column p-2"} key={attr.key}>
            <div className="flex">
                <Image src="/images/galleria/galleria7.jpg"
                       alt="Image"
                       width="250"
                       indicatorIcon={icon}
                       onClick={() => {
                           console.log("Clicked")
                       }}
                       onError={(e) => e.target.src = "https://www.shutterstock.com/image-vector/default-ui-image-placeholder-wireframes-600nw-1037719192.jpg"}
                />
            </div>
            <div className="flex">
                <p>{attr.title}</p>
            </div>
        </div>
    )
}
